import dayjs from "dayjs";

export default function CraeteKoonServiceForm(form: string, data: any) {
    var spareParts = ''
    var FormName = ''
    var logo = ''
    console.log(data);

    switch (form) {
        case 'koon':
            FormName = 'Koon Service'
            logo = `<img
      src="data:image/png;base64,"
      alt="Logo" width="150" height="70">`
            break
        case 'advice':
            FormName = 'Advice Service'
            logo = `<img
              src="data:image/png;base64,"
              alt="Logo" width="70" height="70" style="top: 2px; left: 2px; right: 2px; bottom: 2px">`
            break
        case 'tcc':
            FormName = 'TCCtech Service'
            logo = `<img
      src="data:image/png;base64,"
      alt="Logo" width="130" height="70" style="top: 2px; left: 2px; right: 2px; bottom: 2px">`
            break
        default:
            FormName = 'Koon Service'
    }
    if (data.spare_item != null && data.store_item != null) {
        for (var i = 0; i < 5; i++) {
            spareParts += `
            <tr>
                <td style="word-wrap: break-word; overflow-wrap: break-word;">
                ${data.spare_item[i] ? data.spare_item[i].category || "" : "_"}
                </td>
                <td style="word-wrap: break-word; overflow-wrap: break-word;"></td>
                <td style="word-wrap: break-word; overflow-wrap: break-word;">
                ${data.store_item[i] ? data.store_item[i].brand || "" : "_"}
                </td>
                <td style="word-wrap: break-word; overflow-wrap: break-word;">
                ${data.store_item[i] ? data.store_item[i].serial_number || "" : "_"}
                </td>
                <td style="word-wrap: break-word; overflow-wrap: break-word;">
                ${data.spare_item[i] ? data.spare_item[i].brand || "" : "_"}
                </td>
                <td style="word-wrap: break-word; overflow-wrap: break-word;">
                ${data.spare_item[i] ? data.spare_item[i].serial_number || "" : "_"}
                </td>
            </tr>`
        }
    }
    var html_format = `<!DOCTYPE html>
<html lang="en">

<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <style>
        b {
            font-weight: bold;
        }

        underline {
            text-decoration: underline;
        }

        body {
            font-family: Arial, sans-serif;
            margin: 0;
            padding: 0;
        }

        .form-container {
            width: 210mm;
            /* A4 width */
            margin: 0 auto;
            padding: 10mm;
            box-sizing: border-box;
            background-color: #fff;
        }

        table {
            font-size: 12px;
            width: 100%;
            table-layout: fixed;
            /* Ensure consistent column width */
        }

        td,
        th {
            padding: 5px;
            box-sizing: border-box;
            text-align: left;
        }

        .header-table {
            width: 100%;
            border-collapse: collapse;
        }

        .header-table td {
            /* border: 1px solid black; */
        }

        .nested-table {
            width: 100%;
        }

        /* Ensure consistent row height and avoid page breaks inside rows */
        tr {
            page-break-inside: avoid;
            page-break-after: auto;
        }

        @media print {
            body {
                margin: 0;
                padding: 0;
                background-color: white;
            }

            header,
            footer {
                display: none;
            }

            .form-container {
                width: 100%;
                margin: 0;
                padding: 10mm;
                border: none;
            }

            table {
                width: 100%;
            }

            @page {
                size: A4;
                margin: 0;
            }
        }
    </style>
</head>

<body>
    <div class="form-container">
        <table class="header-table">
            <tbody>
                <!-- Header Row -->
                <tr>
                    <td colspan="5" style="border: 1px solid black; text-align: center;">${logo}</td>
                    <td colspan="10"
                        style="border: 1px solid black; font-size: 20px; font-weight: bold; text-align: center;">${FormName}</td>
                    <td colspan="10" style="border: 1px solid black;">
                        <table class="nested-table">
                            <tbody>
                                <tr>
                                    ${form != 'tcc' ? `<td colspan="2"><b>Ticket No:</b> ${data?.ticket_number}</td>` : `<td colspan="2"><b>Incident No:</b> ${data?.inc_number}</td>`}
                                </tr>
                                <tr>
                                    <td colspan="2"><b>Report Date:</b> ${dayjs(new Date()).format("DD-MM-YYYY")} <b>Time:</b> ${dayjs(new Date()).format("HH:MM")} </td>
                                </tr>
                            </tbody>
                        </table>
                    </td>
                </tr>

                <!-- Section 1 -->
            <tbody style="border: 1px solid black;">
                ${form != 'tcc' ? `                <tr>
                    <td colspan="12"><b> / customer:</b>
                        <underline>${data.customer.fullname}</underline>
                    </td>
                </tr>` : ''}
                <tr>
                    <td colspan="12"><b> / shop:</b>
                        <underline>${data.shop.shop_number + data.shop.shop_name}</underline>
                    </td>
                    <td colspan="12"><b> / phone:</b>
                        <underline>${data.shop.phone}</underline>
                    </td>
                </tr>
                <tr>
                    <td colspan="12"><b> / reported by:</b>
                        <underline>${data.shop.shop_name}</underline>
                    </td>
                    <td colspan="12"><b>/mobile 1:</b>
                        <underline>${data.shop.phone}</underline>
                    </td>
                </tr>
                <tr>
                    <td colspan="12"><b>Email address:</b>
                        <underline>${data.shop.email}</underline>
                    </td>
                    <td colspan="12"><b> / Mobile 2:</b>
                        <underline></underline>
                    </td>
                </tr>
                <tr>
                    <td colspan="12"><b> / Contact:</b>
                        <underline>${data.contact_name || ''}</underline>
                    </td>
                    <td colspan="12"><b> / Address:</b>
                        <underline>${data.shop.location_name || ''}</underline>
                    </td>
                </tr>
            </tbody>

            <!-- Section 2 -->
            <tbody style="border: 1px solid black;">
                <tr>
                    <td colspan="12"><b>/Brand :</b>
                        <underline>${data.item_brand}</underline>
                    </td>
                    <td colspan="12"><b> / Model :</b>
                        <underline>${data.item_model}</underline>
                    </td>
                </tr>
                <tr>
                    <td colspan="12"><b>/Equipment :</b>
                        <underline>${data.item_category}</underline>
                    </td>
                    <td colspan="12"><b> S/N :</b>
                        <underline>${data.item_sn}</underline>
                    </td>
                </tr>
                <tr>
                    <td colspan="12"><b>/Expired :</b>
                        <underline>${data.warranty_exp}</underline>
                    </td>
                    <td colspan="12"><b> / SLA :</b>
                        <underline>${data.sla_priority_level}</underline>
                    </td>
                </tr>
                <tr>
                    <td colspan="24"><b> / Description :</b>
                        <underline>${data.description.replace(/\n/g, '<br>')}</underline>
                    </td>
                </tr>
            </tbody>
            <!-- Section 3 -->
            <tbody style="border: 1px solid black;">
                <tr>
                    <td colspan="24">
                         / Ticket Description: <underline>${data.investigation}</underline>
                    </td>
                </tr>
                <tr>
                    <td colspan="24">
                         / Solution: <underline>${data.solution}</underline>
                    </td>
                </tr>
                <tr>
                    <td colspan="7" style="text-align: left; vertical-align: top;">
                       / Resolved:
                    </td>
                    <td colspan="3" style="text-align: left; vertical-align: top;">
                      <input 
                        onclick="return false;"
                        type="checkbox" 
                        id="resolved1" 
                        name="resolved" 
                        value="resolved" 
                      <label for="resolved1"></label>
                    </td>
                    <td colspan="14" style="text-align: left; vertical-align: top;">
                      <input 
                        onclick="return false;"
                        type="checkbox" 
                        id="resolved2" 
                        name="resolved" 
                        value="notresolved"
                      <label for="resolved2">
                          ():
                      </label>
                      <u style="overflow-wrap: break-word;">${data.resolve_status ? '' : data.resolve_remark}</u>
                    </td>
                    <script>
                          const checkbox1 = document.getElementById('resolved1');
                          const checkbox2 = document.getElementById('resolved2');

                          // Compare the values
                          if ("${data.resolve_status}" === "true") {
                            checkbox1.checked = true;
                          } else {
                            // If values don't match, you can choose to uncheck or leave as is
                            checkbox2.checked = true;
                          }
                    </script>
                </tr>
                <tr>
                    <tr>
                        <td colspan="4" style="vertical-align: top;">/Action:</td>
                        <td colspan="4" style="vertical-align: top;">
                            <input type="checkbox" id="action1" name="action" value="repair" onclick="return false;">
                            <label for="action1"> / Repair</label>
                        </td>
                        <td colspan="6" style="vertical-align: top;">
                            <input type="checkbox" id="action2" name="action" value="clean" onclick="return false;">
                            <label for="action2"> / Clean </label>
                        </td>
                        <td colspan="6" style="vertical-align: top;">
                            <input type="checkbox" id="action3" name="action" value="spare" onclick="return false;">
                            <label for="action3"> / Temporary</label>
                        </td>
                        <td colspan="4" style="vertical-align: top;">
                            <input type="checkbox" id="action4" name="action" value="replace" onclick="return false;">
                            <label for="action4"> / Permanent</label>
                        </td>
                    </tr>

                    <script>
                            const actions = "${data.action}".split(',').map(action => action.trim());
                            // Reference the checkboxes
                            const action1 = document.getElementById('action1');
                            const action2 = document.getElementById('action2');
                            const action3 = document.getElementById('action3');
                            const action4 = document.getElementById('action4');
                            const isChecked = (action) => actions.includes(action);

                            // Set the checked state based on the action values
                            if (action1) action1.checked = isChecked("repair");
                            if (action2) action2.checked = isChecked("clean");
                            if (action3) action3.checked = isChecked("spare");
                            if (action4) action4.checked = isChecked("replace");
                    </script>
                </tr>
                <!-- Spare Parts -->
                <tr>
                    <td colspan="25" style="background-color: bisque;">
                        <table width="100%" border="1px solid black">
                            <thead>
                                <tr>
                                    <th style="text-align: center; vertical-align: top;"> / Spare Part</th>
                                    <th style="text-align: center; vertical-align: top;">Asset No.</th>
                                    <th style="text-align: center; vertical-align: top;">Brand Model </br> ()
                                    </th>
                                    <th style="text-align: center; vertical-align: top;">Serial No. </br> ()
                                    </th>
                                    <th style="text-align: center; vertical-align: top;">Brand Model </br> ()
                                    </th>
                                    <th style="text-align: center; vertical-align: top;">Serial No. </br> ()
                                    </th>
                                </tr>
                            </thead>
                            <tbody>
                             ${spareParts}
                            </tbody>
                        </table>
                    </td>
                </tr>
            </tbody>
            <!-- Signatures -->
            <tbody style="border: 1px solid black;">
                <tr>
                    <td colspan="12" style="text-align: center; vertical-align: top; border-right: 1px solid #000;">
                        / Stamp :
                    </td>
                    <td colspan="13">
                        <table style="width: 100%; border-collapse: collapse;">
                            <tr style="border: none;">
                                <td style="text-align: right;" colspan="2">/ Customer Sign:</td>
                                <td colspan="2"></td>
                            </tr>
                            <tr style="border: none;"> 
                                <td style="text-align: right;" colspan="2">/ Service Sign:</td>
                                <td colspan="2"></td>
                            </tr style="border: none;">
                            <tr style="border: none;">
                                <td style="text-align: right;" colspan="2"> / Date:</td>
                                <td colspan="2">${dayjs(data.time_in).format('DD-MM-YYYY')}</td>
                            </tr>
                            <tr>
                            <tr style="border-top: 1px solid #000;">
                                <td style="text-align: center; border-right: 1px solid #000;" colspan="2">/ Time In:</td>
                                <td style="text-align: center;" colspan="2"> / Time Out:</td>
                            </tr>
                            <tr style="border: none;">
                                <td style="text-align: center; border-right: 1px solid #000;" colspan="2">${data.time_in}</td>
                                <td style="text-align: center;" colspan="2">${data.time_out}</td>
                            </tr>
                        </table>
                    </td>
                </tr>
            </tbody>
        </table>
    </div>
    <script>
        window.print();
    </script>
</body>

</html>`
    return html_format
}